import { NavLink } from "react-router-dom";
export default function Card( {id, name, status, species, origin, gender, image, onClose}) {

   
   return (
      
      <div>
         <button onClick={() => onClose(id)}>X</button>
         <button>        
            <Link to={`detail/${id}`}>
             <h2>Nombre:{name}</h2>
            </Link>
         <h2>Species:{species} </h2>
         <h2>Gender:{gender} </h2>
         <h2>Status:{status}</h2>
         <h2>Origin:{origin} </h2>
         <img src={image} alt='' />
         </button>
      </div>
   );
}
